script: |
  super -f text -I q10156.spq | sort > q10156.out

inputs:
  - name: q10156.spq
    data: |
      SELECT ALL - col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 NOT IN ( + - 62, + 19 * + 76 * - col0, - col1, 20, + col0 * + ( + col0 ) / - col0, 67, + + 24 );
  - name: tab2

outputs:
  - name: q10156.out
    data: |
      -46
      -64
      -75
